import schedule from '../../../data/Schedule.json';
import film from '../../../data/Film.json';


const freeTime = [];

schedule.map((user) => (
        Object.entries(user.plan).map((plan, time) => {
            if (user.plan[plan] === 'free') {
                freeTime.push(user.plan[time]);
            }

            return freeTime;
        })
));
const result = [];
film.map((user) => (
    Object.keys(user.Date).map((time) => {
        for (let i = 0; i >= freeTime.length; i++) {
            if (freeTime[i] === user.Date[time]) {
                result.push(user.Title);
            }
            return result;
        }
    })
))

export const Service = () => (
    <div className="Service">
        {result.map(film => (
            <h1>{film}</h1>
        ))}
    </div>
)
